import { Link } from "react-router-dom";

const EVENTS = [
    { id: 'p1', title: 'EVENT 1'},
    {id: 'p2', title: 'EVENT 2'},
    {id: 'p3', title: 'EVENT 3'}
]

function EventPages() {
    return (<>
        <h1>The event page</h1>

        <ul>
            {EVENTS.map((event) => (
                <li key={event.id}>
                    <Link to={`/`}> {event.title}</Link>
                </li>
            ))}
        </ul>
    
    </>
        
    )
}

export default EventPages;
